import React from "react";
//import timeago from "epoch-timeago";

const Stories = ({ state}:any) => {
  return (
    <>
      {state.map(
        ({ item, author, title, score, comments_count, time, url }:any) => (
          <tr key={item}>
            <td style={{ padding: "0px" }}>
              <i
                className="fas fa-sort-up"
                style={{
                  fontSize: "30px",
                  marginTop: "16px",
                  padding: "0px",
                  marginRight: "0px"
                }}
              />
            </td>
            <td
              style={{
                padding: "0px",
                paddingTop: "13px",
                paddingRight: "15px",
                color: "#828282"
              }}
            >
              &nbsp;
              {score}
            </td>
            <td style={{ paddingRight: "80px", fontSize: "600" }}>
              <a href={url} target="_blank" rel="noopener noreferrer">
                {title}
              </a>
            </td>
            <React.Fragment >
              <td style={{ color: "#828282" }}>
                <i className="fas fa-user" />{" "}
                <a
                  href={`https://news.ycombinator.com/user?id=${author}`}
                  target="_blank"
                  style={{ color: "#828282" }}
                  rel="noopener noreferrer"
                >
                  {author}
                </a>
              </td>
              <td style={{ color: "#828282" }}>
                <i className="fas fa-globe" />{" "}
                <a
                  href={`https://${
                    url
                      .replace("http://", "")
                      .replace("https://", "")
                      .split(/[/?#]/)[0]
                  }`}
                  target="_blank"
                  style={{ color: "#828282" }}
                  rel="noopener noreferrer"
                >
                  {url
                    .replace("http://", "")
                    .replace("https://", "")
                    .split(/[/?#]/)[0]
                    .replace("www.", "")}
                </a>
              </td>
              <td style={{ color: "#828282" }}>

              </td>
              <td style={{ color: "#828282" }}>
                <i className="far fa-comment-alt" />{" "}
                <a
                  href={`https://news.ycombinator.com/item?id=${item}`}
                  target="_blank"
                  style={{ color: "#828282" }}
                  rel="noopener noreferrer"
                >
                  {comments_count}
                </a>
              </td>
            </React.Fragment>
          </tr>
        )
      )}
    </>
  );
};
export default Stories;
